import React, { useState } from "react";
import Sidebar from "../components/Sidebar";

const MyProfile = () => {
  const [profile, setProfile] = useState({
    firstName: "John",
    lastName: "Doe",
    phone: "1234567890",
    email: "john.doe@example.com",
    address: "",
    city: "",
    postalCode: "",
    country: "India",
    about: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProfile({ ...profile, [name]: value });
  };

  return (
    <div className="bg-[#081120] min-h-screen flex">

      {/* SIDEBAR LEFT */}
      <Sidebar />

      {/* RIGHT CONTENT */}
      <div className="flex-1 p-10 text-white">

        {/* Page Header */}
        <h1 className="text-3xl font-bold mb-6">Edit Profile</h1>

        <div className="bg-[#0E1A2B] p-8 rounded-xl shadow-xl">

          {/* Basic Info */}
          <div className="grid md:grid-cols-2 gap-6 mb-6">
            <Input label="First Name" value={profile.firstName} name="firstName" onChange={handleChange} placeholder="First Name" />
            <Input label="Last Name" value={profile.lastName} name="lastName" onChange={handleChange} placeholder="Last Name" />
          </div>

          <div className="grid md:grid-cols-2 gap-6 mb-6">
            <Input label="Email" value={profile.email} name="email" onChange={handleChange} placeholder="Email" />
            <Input label="Phone Number" value={profile.phone} name="phone" onChange={handleChange} placeholder="Phone Number" />
          </div>

          <Input label="Address" value={profile.address} name="address" onChange={handleChange} placeholder="Enter Address" />

          <div className="grid md:grid-cols-3 gap-6 my-6">
            <Input label="City" value={profile.city} name="city" onChange={handleChange} placeholder="City" />
            <Input label="Postal Code" value={profile.postalCode} name="postalCode" onChange={handleChange} placeholder="ZIP Code" />
            <Select label="Country" value={profile.country} name="country" onChange={handleChange} options={["India", "USA", "UK", "Canada"]} />
          </div>

          {/* Social Links */}
          <h2 className="text-xl font-semibold mt-4 mb-4">Social Links</h2>

          <div className="grid md:grid-cols-2 gap-6 mb-6">
            <Input label="Facebook" placeholder="https://facebook.com/username" />
            <Input label="Google" placeholder="https://google.com/username" />
          </div>

          <div className="grid md:grid-cols-2 gap-6 mb-6">
            <Input label="Twitter" placeholder="https://twitter.com/username" />
            <Input label="Pinterest" placeholder="https://pinterest.com/username" />
          </div>

          {/* About */}
          <div className="mb-6">
            <label className="block mb-2 font-medium">About Me</label>
            <textarea
              rows="4"
              name="about"
              placeholder="Write something about yourself..."
              value={profile.about}
              onChange={handleChange}
              className="w-full bg-gray-900 border border-gray-700 rounded-md p-3 text-white"
            ></textarea>
          </div>

          <button className="px-6 py-3 rounded-lg text-white bg-gradient-to-r from-blue-800 to-blue-500 font-semibold">
            Save Changes
          </button>

        </div>
      </div>
    </div>
  );
};

/* Reusable Input Component */
const Input = ({ label, placeholder, value, name, onChange }) => (
  <div>
    <label className="block mb-2 font-medium">{label}</label>
    <input
      type="text"
      placeholder={placeholder}
      value={value}
      name={name}
      onChange={onChange}
      className="w-full bg-gray-900 border border-gray-700 rounded-md p-3 text-white"
    />
  </div>
);

/* Reusable Select Component */
const Select = ({ label, options, value, name, onChange }) => (
  <div>
    <label className="block mb-2 font-medium">{label}</label>
    <select
      value={value}
      name={name}
      onChange={onChange}
      className="w-full bg-gray-900 border border-gray-700 rounded-md p-3 text-white"
    >
      {options.map((op) => (
        <option key={op}>{op}</option>
      ))}
    </select>
  </div>
);

export default MyProfile;
